import { createSlice } from '@reduxjs/toolkit'

export const logout = createSlice({
  name: 'logout',
  initialState: {
    logout: [],
  },
  reducers: {
    setUser: (state, action) => {
      state.user = [];
    }
  },
})

export const { setUser } = logout.actions

export default logout.reducer
